function parseRow(row) {
    if (typeof row != 'string') {
        throw new Error('请输入字符串类型');
    }
    let res = {};
    let rowArr = row.split('\t');
    res.tradeId = rowArr[0];
    res.userId = rowArr[1];
    res.tradeType = rowArr[2];
    res.tradeTypeValue = rowArr[3];
    res.tradeInfo = rowArr[4];
    res.tradeMoney = rowArr[5];
    res.payWay = rowArr[6];
    res.createTime = rowArr[7];
    res.thirdPartyMoney = rowArr[8];
    res.balance = rowArr[9];
    res.uncheck = rowArr[10];
    return res;
}


function ExportRow(data, dataType) {
    let res = {type: '', info: '', money: 0, payWay: '', time: '', balance: 0};
    let tradeInfo;
    switch (dataType) {
        case 3:
            res.type = '活动收款';
            res.money = data.tradeMoney - data.thirdPartyMoney;
            res.time = data.createTime;
            tradeInfo = JSON.parse(data.tradeInfo);
            res.info = '活动《' + tradeInfo.activity.title + '》收到用户“' + tradeInfo.apply.user.nick + '”的报名款' + (res.money / 100).toFixed(2) + '，票价名为：' + tradeInfo.apply.ticketName;
            res.balance = balance = balance + parseInt(res.money);
            break;
        case 4:
            res.type = '退款支出';
            res.money = data.tradeMoney;
            res.time = data.createTime;
            tradeInfo = JSON.parse(data.tradeInfo);
            res.info = '退款支出了：' + (res.money / 100).toFixed(2) + '元' + '，' + '退给《' + tradeInfo.activity.title + "》活动“" + tradeInfo.apply.user.nick + '”报名款';
            res.balance = balance = balance - parseInt(res.money);
            break;
        case 6:
            if (!Array.isArray(data)) {
                throw new TypeError("when dataType value is 6,data must be Array");
            }
            res.type = '退款充值';
            res.money = data[0].tradeMoney;
            res.time = data[0].createTime;
            let names = null;
            for (let i = 0, len = data.length; i < len; i++) {
                tradeInfo = JSON.parse(data[i].tradeInfo);
                if (names) {
                    names = names + ',' + tradeInfo.userName;
                } else {
                    names = tradeInfo.userName;
                }
            }
            res.info = '给“' + names + '”退款充值了' + (res.money / 100).toFixed(2) + '元';
            res.balance = balance = balance + parseInt(res.money);
            break;
    }

    return res;
}

